import { useState } from 'react';
import { useProjects } from '../hooks/useProjects';
import { Terminal } from '../components/terminal/Terminal';
import { ShellControls } from '../components/terminal/ShellControls';
import { useShell } from '../contexts/ShellContext';
import {
  Select,
  SelectContent,
  SelectItem,
  SelectTrigger,
  SelectValue,
} from '../components/ui/select';
import { Card, CardContent, CardHeader, CardTitle } from '../components/ui/card';
import { Skeleton } from '../components/ui/skeleton';
import { Alert, AlertDescription } from '../components/ui/alert';
import { AlertCircle, Terminal as TerminalIcon } from 'lucide-react';

export default function Shell() {
  const { data: projects, isLoading, error } = useProjects();
  const [selectedProjectId, setSelectedProjectId] = useState<string>('');
  const { getSession } = useShell();

  const selectedProject = projects?.find((p) => p.id === selectedProjectId);
  const sessionId = `shell-${selectedProjectId}`;
  const session = getSession(sessionId);

  const handleRestart = () => {
    // Reload page to restart session
    window.location.reload();
  };

  // Loading state
  if (isLoading) {
    return (
      <div className="flex flex-col h-full">
        <div className="p-4 space-y-4">
          <h1 className="text-3xl font-bold">Shell</h1>
          <Skeleton className="h-10 w-64" />
        </div>
      </div>
    );
  }

  // Error state
  if (error) {
    return (
      <div className="flex flex-col h-full p-4">
        <h1 className="text-3xl font-bold mb-4">Shell</h1>
        <Alert variant="destructive">
          <AlertCircle className="h-4 w-4" />
          <AlertDescription>
            {error.message || 'Failed to load projects. Please try again.'}
          </AlertDescription>
        </Alert>
      </div>
    );
  }

  // Empty state - no projects
  if (!projects || projects.length === 0) {
    return (
      <div className="flex flex-col h-full p-4">
        <h1 className="text-3xl font-bold mb-4">Shell</h1>
        <Card>
          <CardContent className="flex flex-col items-center justify-center py-16 text-center">
            <TerminalIcon className="h-16 w-16 text-muted-foreground mb-4" />
            <h3 className="text-lg font-semibold mb-2">No projects found</h3>
            <p className="text-sm text-muted-foreground max-w-sm">
              Create a project first to use the interactive shell.
            </p>
          </CardContent>
        </Card>
      </div>
    );
  }

  // No project selected
  if (!selectedProjectId) {
    return (
      <div className="flex flex-col h-full">
        <div className="p-4 space-y-4">
          <h1 className="text-3xl font-bold">Shell</h1>
          <Card>
            <CardHeader>
              <CardTitle>Select a Project</CardTitle>
            </CardHeader>
            <CardContent>
              <Select value={selectedProjectId} onValueChange={setSelectedProjectId}>
                <SelectTrigger className="w-full max-w-md">
                  <SelectValue placeholder="Select a project..." />
                </SelectTrigger>
                <SelectContent>
                  {projects.map((project) => (
                    <SelectItem key={project.id} value={project.id}>
                      {project.name}
                    </SelectItem>
                  ))}
                </SelectContent>
              </Select>
              <p className="text-sm text-muted-foreground mt-2">
                Choose a project to start an interactive shell session
              </p>
            </CardContent>
          </Card>
        </div>
      </div>
    );
  }

  // Shell view with terminal
  return (
    <div className="flex flex-col h-full">
      {/* Header with project selector */}
      <div className="p-4 border-b">
        <div className="flex items-center gap-4">
          <h1 className="text-3xl font-bold">Shell</h1>
          <Select value={selectedProjectId} onValueChange={setSelectedProjectId}>
            <SelectTrigger className="w-64">
              <SelectValue />
            </SelectTrigger>
            <SelectContent>
              {projects.map((project) => (
                <SelectItem key={project.id} value={project.id}>
                  {project.name}
                </SelectItem>
              ))}
            </SelectContent>
          </Select>
        </div>
      </div>

      {/* Controls */}
      <ShellControls
        status={session?.status || 'disconnected'}
        projectName={selectedProject?.name}
        onRestart={handleRestart}
      />

      {/* Terminal */}
      <div className="flex-1 overflow-hidden">
        <Terminal sessionId={sessionId} projectId={selectedProjectId} />
      </div>
    </div>
  );
}

import { useParams, useNavigate } from "react-router-dom";
import { useProject } from "../hooks/useProjects";
import { Button } from "../components/ui/button";
import { Skeleton } from "../components/ui/skeleton";
import { AlertCircle, ArrowLeft, MessageSquare, Terminal as TerminalIcon } from "lucide-react";
import { Alert, AlertDescription } from "../components/ui/alert";
import { Tabs, TabsContent, TabsList, TabsTrigger } from "../components/ui/tabs";
import { Terminal } from "../components/terminal/Terminal";
import { ShellControls } from "../components/terminal/ShellControls";
import { useShell } from "../contexts/ShellContext";

export default function ProjectDetail() {
  const { id } = useParams<{ id: string }>();
  const navigate = useNavigate();
  const { data: project, isLoading, error } = useProject(id!);
  const { getSession } = useShell();

  const sessionId = `shell-${id}`;
  const session = getSession(sessionId);

  const handleRestart = () => {
    window.location.reload();
  };

  // Loading state
  if (isLoading) {
    return (
      <div className="flex flex-col h-full">
        <Skeleton className="h-12 w-full" />
        <div className="flex-1 p-4">
          <Skeleton className="h-full w-full" />
        </div>
      </div>
    );
  }

  // Error state
  if (error) {
    return (
      <div className="space-y-4">
        <Button variant="ghost" onClick={() => navigate("/projects")}>
          <ArrowLeft className="mr-2 h-4 w-4" />
          Back to Projects
        </Button>
        <Alert variant="destructive">
          <AlertCircle className="h-4 w-4" />
          <AlertDescription>
            {error.message || "Failed to load project. Please try again."}
          </AlertDescription>
        </Alert>
      </div>
    );
  }

  // Not found state
  if (!project) {
    return (
      <div className="space-y-4">
        <Button variant="ghost" onClick={() => navigate("/projects")}>
          <ArrowLeft className="mr-2 h-4 w-4" />
          Back to Projects
        </Button>
        <Alert>
          <AlertCircle className="h-4 w-4" />
          <AlertDescription>Project not found.</AlertDescription>
        </Alert>
      </div>
    );
  }

  return (
    <Tabs defaultValue="chat" className="flex flex-col h-full">
      <div className="flex items-center justify-between border-b px-6 py-4">
        <div className="flex flex-col gap-1">
          <div className="text-sm font-semibold text-muted-foreground">Project</div>
          <div className="text-base font-medium">{project.name}</div>
        </div>
        <TabsList>
          <TabsTrigger value="chat">
            <MessageSquare className="mr-2 h-4 w-4" />
            Chat
          </TabsTrigger>
          <TabsTrigger value="shell">
            <TerminalIcon className="mr-2 h-4 w-4" />
            Shell
          </TabsTrigger>
        </TabsList>
      </div>
      <TabsContent value="chat" className="flex-1 p-4 m-0">
        <div className="text-muted-foreground">Chat content coming soon...</div>
      </TabsContent>
      <TabsContent value="shell" className="flex-1 m-0 flex-col data-[state=inactive]:hidden" forceMount={true}>
        <ShellControls
          status={session?.status || 'disconnected'}
          projectName={project.name}
          onRestart={handleRestart}
        />
        <div className="flex-1 overflow-hidden">
          <Terminal sessionId={sessionId} projectId={id!} />
        </div>
      </TabsContent>
    </Tabs>
  );
}

import { useEffect, useRef, useCallback } from 'react';
import { Terminal as XTerm } from '@xterm/xterm';
import { FitAddon } from '@xterm/addon-fit';
import { WebglAddon } from '@xterm/addon-webgl';
import { ClipboardAddon } from '@xterm/addon-clipboard';
import { useShell } from '../../contexts/ShellContext';
import { useShellWebSocket } from '../../hooks/useShellWebSocket';
import '@xterm/xterm/css/xterm.css';
import './terminal.css';

interface TerminalProps {
  sessionId: string;
  projectId: string;
  onConnect?: () => void;
  onDisconnect?: () => void;
}

export function Terminal({ sessionId, projectId, onConnect, onDisconnect }: TerminalProps) {
  const { getSession, addSession, updateSession } = useShell();
  const containerRef = useRef<HTMLDivElement>(null);
  const terminalRef = useRef<XTerm | null>(null);
  const fitAddonRef = useRef<FitAddon | null>(null);
  const resizeObserverRef = useRef<ResizeObserver | null>(null);

  // Stable callbacks for WebSocket
  const handleOutput = useCallback((data: string) => {
    terminalRef.current?.write(data);
  }, []);

  const handleExit = useCallback((exitCode: number) => {
    terminalRef.current?.writeln(`\r\n\x1b[1;33m[Process exited with code ${exitCode}]\x1b[0m\r\n`);
  }, []);

  // WebSocket connection
  const { isConnected, connect, disconnect, sendInput, sendResize } = useShellWebSocket({
    sessionId,
    projectId,
    enabled: true,
    onOutput: handleOutput,
    onExit: handleExit,
  });

  // Initialize terminal on mount
  useEffect(() => {
    if (!containerRef.current) return;

    // Check if we have an existing session
    const existingSession = getSession(sessionId);

    if (existingSession?.terminal) {
      // Reuse existing terminal instance
      terminalRef.current = existingSession.terminal;
      fitAddonRef.current = new FitAddon();
      terminalRef.current.loadAddon(fitAddonRef.current);

      // Open terminal in new container
      if (containerRef.current) {
        terminalRef.current.open(containerRef.current);
        fitAddonRef.current.fit();
      }
    } else {
      // Create new terminal instance
      const terminal = new XTerm({
        cursorBlink: true,
        fontSize: 14,
        fontFamily: '"Cascadia Code", "Fira Code", "Courier New", monospace',
        scrollback: 10000,
        theme: {
          background: '#1e1e1e',
          foreground: '#d4d4d4',
          cursor: '#ffffff',
          cursorAccent: '#000000',
          selectionBackground: '#264f78',
          // ANSI colors (16-color palette)
          black: '#000000',
          red: '#cd3131',
          green: '#0dbc79',
          yellow: '#e5e510',
          blue: '#2472c8',
          magenta: '#bc3fbc',
          cyan: '#11a8cd',
          white: '#e5e5e5',
          brightBlack: '#666666',
          brightRed: '#f14c4c',
          brightGreen: '#23d18b',
          brightYellow: '#f5f543',
          brightBlue: '#3b8eea',
          brightMagenta: '#d670d6',
          brightCyan: '#29b8db',
          brightWhite: '#ffffff',
        },
      });

      terminalRef.current = terminal;

      // Create FitAddon
      const fitAddon = new FitAddon();
      fitAddonRef.current = fitAddon;
      terminal.loadAddon(fitAddon);

      // Create WebGL addon with fallback
      try {
        const webglAddon = new WebglAddon();
        webglAddon.onContextLoss(() => {
          console.warn('[Terminal] WebGL context lost, disposing addon');
          webglAddon.dispose();
        });
        terminal.loadAddon(webglAddon);
      } catch (e) {
        console.warn('[Terminal] WebGL addon failed to load, using canvas renderer:', e);
      }

      // Create Clipboard addon
      const clipboardAddon = new ClipboardAddon();
      terminal.loadAddon(clipboardAddon);

      // Open terminal in container
      if (containerRef.current) {
        terminal.open(containerRef.current);
        fitAddon.fit();
      }

      // Add session to context
      addSession(sessionId, {
        projectId,
        terminal,
        containerElement: null,
        status: 'disconnected',
      });

      // Handle user input - send to WebSocket
      terminal.onData((data) => {
        sendInput(data);
      });

      // Keyboard shortcuts
      terminal.attachCustomKeyEventHandler((event) => {
        // Cmd/Ctrl+C for copy (only when text is selected)
        if ((event.ctrlKey || event.metaKey) && event.code === 'KeyC' && terminal.hasSelection()) {
          return false; // Let browser handle copy
        }

        // Cmd/Ctrl+V for paste
        if ((event.ctrlKey || event.metaKey) && event.code === 'KeyV') {
          return false; // Let browser handle paste
        }

        // Allow all other keys to be handled by terminal
        return true;
      });
    }

    // Set up ResizeObserver for auto-fitting
    if (containerRef.current && fitAddonRef.current) {
      const resizeObserver = new ResizeObserver(() => {
        if (fitAddonRef.current && terminalRef.current) {
          try {
            fitAddonRef.current.fit();
            const dims = fitAddonRef.current.proposeDimensions();
            if (dims) {
              sendResize(dims.cols, dims.rows);
            }
          } catch (e) {
            console.warn('[Terminal] Fit failed:', e);
          }
        }
      });

      resizeObserver.observe(containerRef.current);
      resizeObserverRef.current = resizeObserver;
    }

    // Cleanup on unmount
    return () => {
      if (resizeObserverRef.current) {
        resizeObserverRef.current.disconnect();
      }

      // Save terminal state in context (don't dispose - we want persistence)
      if (terminalRef.current) {
        updateSession(sessionId, {
          terminal: terminalRef.current,
          containerElement: null,
        });
      }
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [sessionId, projectId]); // Only re-run if session/project changes

  // Handle connection
  useEffect(() => {
    if (isConnected && onConnect) {
      onConnect();
    } else if (!isConnected && onDisconnect) {
      onDisconnect();
    }
  }, [isConnected, onConnect, onDisconnect]);

  // Auto-connect on mount (with small delay to ensure terminal is ready)
  useEffect(() => {
    let timer: ReturnType<typeof setTimeout> | null = null;

    timer = setTimeout(() => {
      if (terminalRef.current && fitAddonRef.current) {
        const dims = fitAddonRef.current.proposeDimensions();
        if (dims) {
          connect(dims.cols, dims.rows);
        }
      }
    }, 100);

    return () => {
      if (timer) clearTimeout(timer);
      disconnect();
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []); // Only run once on mount

  return (
    <div ref={containerRef} className="terminal-container" />
  );
}

import { useEffect, useRef, useCallback, useState } from 'react';
import { useShell } from '../contexts/ShellContext';

interface UseShellWebSocketOptions {
  sessionId: string;
  projectId: string;
  enabled?: boolean;
  onOutput?: (data: string) => void;
  onExit?: (exitCode: number, signal?: number) => void;
}

interface ShellWebSocketMessage {
  type: string;
  [key: string]: unknown;
}

export function useShellWebSocket({
  sessionId,
  projectId,
  enabled = true,
  onOutput,
  onExit,
}: UseShellWebSocketOptions) {
  const { updateSessionStatus, updateSession } = useShell();
  const wsRef = useRef<WebSocket | null>(null);
  const [isConnected, setIsConnected] = useState(false);
  const reconnectTimeoutRef = useRef<ReturnType<typeof setTimeout> | null>(null);
  const reconnectAttemptsRef = useRef(0);
  const MAX_RECONNECT_ATTEMPTS = 5;

  const connect = useCallback(
    (cols: number, rows: number) => {
      if (!enabled || wsRef.current) return;

      // Get JWT token from localStorage
      const token = localStorage.getItem('token');
      if (!token) {
        updateSessionStatus(sessionId, 'error', 'No authentication token found');
        return;
      }

      updateSessionStatus(sessionId, 'connecting');

      // Create WebSocket connection with token in query params
      const protocol = window.location.protocol === 'https:' ? 'wss:' : 'ws:';
      const wsUrl = `${protocol}//${window.location.hostname}:3456/shell?token=${encodeURIComponent(token)}`;
      const ws = new WebSocket(wsUrl);
      wsRef.current = ws;

      ws.onopen = () => {
        console.log('[Shell] WebSocket connected');
        setIsConnected(true);
        reconnectAttemptsRef.current = 0;

        // Send init message to spawn shell
        ws.send(
          JSON.stringify({
            type: 'init',
            projectId,
            cols,
            rows,
          })
        );
      };

      ws.onmessage = (event) => {
        try {
          const message = JSON.parse(event.data) as ShellWebSocketMessage;

          switch (message.type) {
            case 'initialized':
              console.log('[Shell] Session initialized:', message.sessionId);
              updateSession(sessionId, {
                sessionId: message.sessionId as string,
              });
              updateSessionStatus(sessionId, 'connected');
              break;

            case 'output':
              if (onOutput && typeof message.data === 'string') {
                onOutput(message.data);
              }
              break;

            case 'exit':
              console.log('[Shell] Process exited:', message);
              if (onExit) {
                onExit(
                  message.exitCode as number,
                  message.signal as number | undefined
                );
              }
              break;

            case 'error':
              console.error('[Shell] Error:', message.message);
              updateSessionStatus(
                sessionId,
                'error',
                message.message as string
              );
              break;

            default:
              console.warn('[Shell] Unknown message type:', message.type);
          }
        } catch (error) {
          console.error('[Shell] Failed to parse message:', error);
        }
      };

      ws.onerror = (error) => {
        console.error('[Shell] WebSocket error:', error);
        updateSessionStatus(sessionId, 'error', 'WebSocket connection error');
      };

      ws.onclose = (event) => {
        console.log('[Shell] WebSocket closed', {
          code: event.code,
          reason: event.reason,
          wasClean: event.wasClean,
        });
        setIsConnected(false);
        wsRef.current = null;
        updateSessionStatus(sessionId, 'disconnected');

        // Attempt reconnection if not too many attempts
        if (
          enabled &&
          reconnectAttemptsRef.current < MAX_RECONNECT_ATTEMPTS
        ) {
          reconnectAttemptsRef.current++;
          const delay = Math.min(1000 * Math.pow(2, reconnectAttemptsRef.current), 30000);
          console.log(
            `[Shell] Reconnecting in ${delay}ms (attempt ${reconnectAttemptsRef.current}/${MAX_RECONNECT_ATTEMPTS})`
          );

          reconnectTimeoutRef.current = setTimeout(() => {
            connect(cols, rows);
          }, delay);
        }
      };
    },
    [enabled, sessionId, projectId, updateSessionStatus, updateSession, onOutput, onExit]
  );

  const disconnect = useCallback(() => {
    if (reconnectTimeoutRef.current) {
      clearTimeout(reconnectTimeoutRef.current);
      reconnectTimeoutRef.current = null;
    }

    if (wsRef.current) {
      wsRef.current.close();
      wsRef.current = null;
      setIsConnected(false);
      updateSessionStatus(sessionId, 'disconnected');
    }
  }, [sessionId, updateSessionStatus]);

  const sendInput = useCallback((data: string) => {
    if (wsRef.current && wsRef.current.readyState === WebSocket.OPEN) {
      wsRef.current.send(
        JSON.stringify({
          type: 'input',
          data,
        })
      );
    }
  }, []);

  const sendResize = useCallback((cols: number, rows: number) => {
    if (wsRef.current && wsRef.current.readyState === WebSocket.OPEN) {
      wsRef.current.send(
        JSON.stringify({
          type: 'resize',
          cols,
          rows,
        })
      );
    }
  }, []);

  // Cleanup on unmount
  useEffect(() => {
    return () => {
      disconnect();
    };
  }, [disconnect]);

  return {
    isConnected,
    connect,
    disconnect,
    sendInput,
    sendResize,
  };
}

import * as pty from 'node-pty';
import * as os from 'os';
import { projectService } from './project.service';

/**
 * Represents an active shell session
 */
interface ShellSession {
  ptyProcess: pty.IPty;
  projectId: string;
  userId: string;
  createdAt: Date;
}

/**
 * Shell Service
 * Manages PTY (pseudo-terminal) sessions for interactive shell access
 */
export class ShellService {
  private sessions = new Map<string, ShellSession>();

  /**
   * Generate a unique session ID
   */
  private generateSessionId(): string {
    return `shell_${Date.now()}_${Math.random().toString(36).substring(2, 9)}`;
  }

  /**
   * Detect platform and return appropriate shell configuration
   */
  private getShellConfig(): { shell: string; args: string[] } {
    const platform = os.platform();

    if (platform === 'win32') {
      // Windows: Use PowerShell
      return {
        shell: 'powershell.exe',
        args: ['-NoLogo'],
      };
    } else {
      // Unix-like (macOS, Linux): Use bash
      return {
        shell: process.env.SHELL || 'bash',
        args: ['--login'],
      };
    }
  }

  /**
   * Create a new shell session
   * @param projectId - Project ID to spawn shell in
   * @param userId - User ID creating the session
   * @param cols - Terminal columns
   * @param rows - Terminal rows
   * @returns Session ID and PTY process
   */
  async createSession(
    projectId: string,
    userId: string,
    cols: number,
    rows: number
  ): Promise<{ sessionId: string; ptyProcess: pty.IPty }> {
    // Get project to determine working directory
    const project = await projectService.getProjectById(projectId);
    if (!project) {
      throw new Error(`Project not found: ${projectId}`);
    }

    // Get platform-specific shell configuration
    const { shell, args } = this.getShellConfig();

    // Create PTY process
    const ptyProcess = pty.spawn(shell, args, {
      name: 'xterm-256color',
      cols,
      rows,
      cwd: project.path,
      env: {
        ...process.env,
        TERM: 'xterm-256color',
        COLORTERM: 'truecolor',
        FORCE_COLOR: '3',
      } as { [key: string]: string },
    });

    // Generate session ID and store session
    const sessionId = this.generateSessionId();
    this.sessions.set(sessionId, {
      ptyProcess,
      projectId,
      userId,
      createdAt: new Date(),
    });

    return { sessionId, ptyProcess };
  }

  /**
   * Get an existing shell session
   * @param sessionId - Session ID
   * @returns Shell session or undefined if not found
   */
  getSession(sessionId: string): ShellSession | undefined {
    return this.sessions.get(sessionId);
  }

  /**
   * Destroy a shell session
   * @param sessionId - Session ID
   */
  destroySession(sessionId: string): void {
    const session = this.sessions.get(sessionId);
    if (session) {
      try {
        session.ptyProcess.kill();
      } catch (error) {
        console.error('Error killing PTY process:', error);
      }
      this.sessions.delete(sessionId);
    }
  }

  /**
   * Cleanup all sessions for a specific user
   * @param userId - User ID
   */
  cleanupUserSessions(userId: string): void {
    for (const [sessionId, session] of this.sessions.entries()) {
      if (session.userId === userId) {
        this.destroySession(sessionId);
      }
    }
  }

  /**
   * Get session count for monitoring
   */
  getSessionCount(): number {
    return this.sessions.size;
  }

  /**
   * Get all active session IDs for a user
   */
  getUserSessions(userId: string): string[] {
    const userSessions: string[] = [];
    for (const [sessionId, session] of this.sessions.entries()) {
      if (session.userId === userId) {
        userSessions.push(sessionId);
      }
    }
    return userSessions;
  }
}

// Export a singleton instance
export const shellService = new ShellService();

import type { FastifyInstance } from 'fastify';
import { shellService } from '../services/shell.service';
import {
  shellMessageSchema,
  type InitMessage,
  type InputMessage,
  type ResizeMessage,
} from '../schemas/shell.schema';

export async function registerShellRoute(fastify: FastifyInstance) {
  fastify.register(async (fastify) => {
    fastify.get(
      '/shell',
      { websocket: true },
      async (socket, request) => {
        try {
          fastify.log.info('Shell WebSocket connection attempt');
          let sessionId: string | null = null;
          let userId: number | null = null;

          // Authenticate the WebSocket connection using JWT from query params or headers
          try {
            // Try to get token from query params or Authorization header
            const query = request.query as { token?: string };
            const token =
              query.token ||
              request.headers.authorization?.replace('Bearer ', '');

            if (!token) {
              socket.send(
                JSON.stringify({
                  type: 'error',
                  message: 'Authentication required',
                })
              );
              socket.close();
              return;
            }

            // Verify JWT token
            const decoded = fastify.jwt.verify(token as string) as {
              userId: number;
            };
            userId = decoded.userId;

            fastify.log.info({ userId }, 'Shell WebSocket client authenticated');
            fastify.log.info('Setting up message handlers...');
          } catch (error) {
            fastify.log.error({ error }, 'Shell WebSocket authentication failed');
            socket.send(
              JSON.stringify({
                type: 'error',
                message: 'Invalid authentication token',
              })
            );
            socket.close();
            return;
          }

        // Handle incoming messages
        socket.on('message', async (rawMessage: Buffer) => {
          try {
            const message = JSON.parse(rawMessage.toString());

            // Validate message schema
            const validatedMessage = shellMessageSchema.parse(message);

            if (validatedMessage.type === 'init') {
              await handleInit(
                validatedMessage,
                userId!,
                socket,
                fastify
              );
            } else if (validatedMessage.type === 'input') {
              handleInput(validatedMessage, sessionId, socket, fastify);
            } else if (validatedMessage.type === 'resize') {
              handleResize(validatedMessage, sessionId, socket, fastify);
            }
          } catch (error) {
            fastify.log.error({ error }, 'Error processing shell message');
            socket.send(
              JSON.stringify({
                type: 'error',
                message:
                  error instanceof Error ? error.message : 'Unknown error',
              })
            );
          }
        });

        // Handle shell initialization
        async function handleInit(
          message: InitMessage,
          userId: number,
          socket: typeof socket,
          fastify: FastifyInstance
        ) {
          try {
            const { projectId, cols, rows } = message;
            fastify.log.info({ projectId, cols, rows, userId }, 'Initializing shell session');

            // Create shell session
            const session = await shellService.createSession(
              projectId,
              userId.toString(),
              cols,
              rows
            );

            sessionId = session.sessionId;
            fastify.log.info({ sessionId }, 'Shell session created successfully');

            // Set up PTY output handler - stream to client
            session.ptyProcess.onData((data) => {
              socket.send(
                JSON.stringify({
                  type: 'output',
                  data,
                })
              );
            });

            // Handle PTY exit
            session.ptyProcess.onExit(({ exitCode, signal }) => {
              fastify.log.info(
                { sessionId, exitCode, signal },
                'PTY process exited'
              );
              socket.send(
                JSON.stringify({
                  type: 'exit',
                  exitCode,
                  signal,
                })
              );
            });

            // Send success response
            socket.send(
              JSON.stringify({
                type: 'initialized',
                sessionId,
              })
            );

            fastify.log.info({ sessionId, projectId }, 'Shell session created');
          } catch (error) {
            fastify.log.error({ error }, 'Failed to initialize shell');
            socket.send(
              JSON.stringify({
                type: 'error',
                message:
                  error instanceof Error
                    ? error.message
                    : 'Failed to initialize shell',
              })
            );
          }
        }

        // Handle user input
        function handleInput(
          message: InputMessage,
          sessionId: string | null,
          socket: typeof socket,
          _fastify: FastifyInstance
        ) {
          if (!sessionId) {
            socket.send(
              JSON.stringify({
                type: 'error',
                message: 'Session not initialized',
              })
            );
            return;
          }

          const session = shellService.getSession(sessionId);
          if (!session) {
            socket.send(
              JSON.stringify({
                type: 'error',
                message: 'Session not found',
              })
            );
            return;
          }

          // Write input to PTY
          session.ptyProcess.write(message.data);
        }

        // Handle terminal resize
        function handleResize(
          message: ResizeMessage,
          sessionId: string | null,
          socket: typeof socket,
          fastify: FastifyInstance
        ) {
          if (!sessionId) {
            socket.send(
              JSON.stringify({
                type: 'error',
                message: 'Session not initialized',
              })
            );
            return;
          }

          const session = shellService.getSession(sessionId);
          if (!session) {
            socket.send(
              JSON.stringify({
                type: 'error',
                message: 'Session not found',
              })
            );
            return;
          }

          // Resize PTY
          session.ptyProcess.resize(message.cols, message.rows);
          fastify.log.info(
            { sessionId, cols: message.cols, rows: message.rows },
            'Terminal resized'
          );
        }

        // Handle disconnection
        socket.on('close', () => {
          if (sessionId) {
            shellService.destroySession(sessionId);
            fastify.log.info({ sessionId }, 'Shell session destroyed');
          }
          fastify.log.info({ userId }, 'Shell WebSocket client disconnected');
        });

        // Handle errors
        socket.on('error', (error: Error) => {
          fastify.log.error({ error, sessionId }, 'Shell WebSocket error');
          if (sessionId) {
            shellService.destroySession(sessionId);
          }
        });
        } catch (error) {
          const errorMessage = error instanceof Error ? error.message : String(error);
          const errorStack = error instanceof Error ? error.stack : undefined;
          fastify.log.error(
            {
              errorMessage,
              errorStack,
              errorType: error?.constructor?.name
            },
            'Fatal error in Shell WebSocket handler'
          );
          try {
            socket.send(
              JSON.stringify({
                type: 'error',
                message: errorMessage,
              })
            );
            socket.close();
          } catch (sendError) {
            const sendErrorMsg = sendError instanceof Error ? sendError.message : String(sendError);
            fastify.log.error({ sendErrorMsg }, 'Failed to send error message to client');
          }
        }
      }
    );
  });
}

