import { useEffect, useRef, useCallback } from 'react';
import { Terminal as XTerm } from '@xterm/xterm';
import { FitAddon } from '@xterm/addon-fit';
import { WebglAddon } from '@xterm/addon-webgl';
import { ClipboardAddon } from '@xterm/addon-clipboard';
import { useShell } from '../../contexts/ShellContext';
import { useShellWebSocket } from '../../hooks/useShellWebSocket';
import '@xterm/xterm/css/xterm.css';
import './terminal.css';

interface TerminalProps {
  sessionId: string;
  projectId: string;
  onConnect?: () => void;
  onDisconnect?: () => void;
}

export function Terminal({ sessionId, projectId, onConnect, onDisconnect }: TerminalProps) {
  const { getSession, addSession, updateSession } = useShell();
  const containerRef = useRef<HTMLDivElement>(null);
  const terminalRef = useRef<XTerm | null>(null);
  const fitAddonRef = useRef<FitAddon | null>(null);
  const resizeObserverRef = useRef<ResizeObserver | null>(null);

  // Stable callbacks for WebSocket
  const handleOutput = useCallback((data: string) => {
    terminalRef.current?.write(data);
  }, []);

  const handleExit = useCallback((exitCode: number) => {
    terminalRef.current?.writeln(`\r\n\x1b[1;33m[Process exited with code ${exitCode}]\x1b[0m\r\n`);
  }, []);

  // WebSocket connection
  const { isConnected, connect, disconnect, sendInput, sendResize } = useShellWebSocket({
    sessionId,
    projectId,
    enabled: true,
    onOutput: handleOutput,
    onExit: handleExit,
  });

  // Initialize terminal on mount
  useEffect(() => {
    if (!containerRef.current) return;

    // Check if we have an existing session
    const existingSession = getSession(sessionId);

    if (existingSession?.terminal) {
      // Reuse existing terminal instance
      terminalRef.current = existingSession.terminal;
      fitAddonRef.current = new FitAddon();
      terminalRef.current.loadAddon(fitAddonRef.current);

      // Open terminal in new container
      if (containerRef.current) {
        terminalRef.current.open(containerRef.current);
        fitAddonRef.current.fit();
      }
    } else {
      // Create new terminal instance
      const terminal = new XTerm({
        cursorBlink: true,
        fontSize: 14,
        fontFamily: '"Cascadia Code", "Fira Code", "Courier New", monospace',
        scrollback: 10000,
        theme: {
          background: '#1e1e1e',
          foreground: '#d4d4d4',
          cursor: '#ffffff',
          cursorAccent: '#000000',
          selectionBackground: '#264f78',
          // ANSI colors (16-color palette)
          black: '#000000',
          red: '#cd3131',
          green: '#0dbc79',
          yellow: '#e5e510',
          blue: '#2472c8',
          magenta: '#bc3fbc',
          cyan: '#11a8cd',
          white: '#e5e5e5',
          brightBlack: '#666666',
          brightRed: '#f14c4c',
          brightGreen: '#23d18b',
          brightYellow: '#f5f543',
          brightBlue: '#3b8eea',
          brightMagenta: '#d670d6',
          brightCyan: '#29b8db',
          brightWhite: '#ffffff',
        },
      });

      terminalRef.current = terminal;

      // Create FitAddon
      const fitAddon = new FitAddon();
      fitAddonRef.current = fitAddon;
      terminal.loadAddon(fitAddon);

      // Create WebGL addon with fallback
      try {
        const webglAddon = new WebglAddon();
        webglAddon.onContextLoss(() => {
          console.warn('[Terminal] WebGL context lost, disposing addon');
          webglAddon.dispose();
        });
        terminal.loadAddon(webglAddon);
      } catch (e) {
        console.warn('[Terminal] WebGL addon failed to load, using canvas renderer:', e);
      }

      // Create Clipboard addon
      const clipboardAddon = new ClipboardAddon();
      terminal.loadAddon(clipboardAddon);

      // Open terminal in container
      if (containerRef.current) {
        terminal.open(containerRef.current);
        fitAddon.fit();
      }

      // Add session to context
      addSession(sessionId, {
        projectId,
        terminal,
        containerElement: null,
        status: 'disconnected',
      });

      // Handle user input - send to WebSocket
      terminal.onData((data) => {
        sendInput(data);
      });

      // Keyboard shortcuts
      terminal.attachCustomKeyEventHandler((event) => {
        // Cmd/Ctrl+C for copy (only when text is selected)
        if ((event.ctrlKey || event.metaKey) && event.code === 'KeyC' && terminal.hasSelection()) {
          return false; // Let browser handle copy
        }

        // Cmd/Ctrl+V for paste
        if ((event.ctrlKey || event.metaKey) && event.code === 'KeyV') {
          return false; // Let browser handle paste
        }

        // Allow all other keys to be handled by terminal
        return true;
      });
    }

    // Set up ResizeObserver for auto-fitting
    if (containerRef.current && fitAddonRef.current) {
      let resizeTimeout: ReturnType<typeof setTimeout> | null = null;
      let lastDims = { cols: 0, rows: 0 };

      const resizeObserver = new ResizeObserver(() => {
        // Debounce resize events to prevent infinite loops
        if (resizeTimeout) {
          clearTimeout(resizeTimeout);
        }

        resizeTimeout = setTimeout(() => {
          if (fitAddonRef.current && terminalRef.current && containerRef.current) {
            try {
              // Check if container has valid dimensions
              const rect = containerRef.current.getBoundingClientRect();
              if (rect.width > 0 && rect.height > 0 && rect.height < 10000) {
                fitAddonRef.current.fit();
                const dims = fitAddonRef.current.proposeDimensions();

                // Only send resize if dimensions actually changed
                if (dims && (dims.cols !== lastDims.cols || dims.rows !== lastDims.rows)) {
                  lastDims = { cols: dims.cols, rows: dims.rows };
                  sendResize(dims.cols, dims.rows);
                }
              }
            } catch (e) {
              console.warn('[Terminal] Fit failed:', e);
            }
          }
        }, 100); // 100ms debounce
      });

      resizeObserver.observe(containerRef.current);
      resizeObserverRef.current = resizeObserver;
    }

    // Cleanup on unmount
    return () => {
      if (resizeObserverRef.current) {
        resizeObserverRef.current.disconnect();
      }

      // Save terminal state in context (don't dispose - we want persistence)
      if (terminalRef.current) {
        updateSession(sessionId, {
          terminal: terminalRef.current,
          containerElement: null,
        });
      }
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [sessionId, projectId]); // Only re-run if session/project changes

  // Handle connection
  useEffect(() => {
    if (isConnected && onConnect) {
      onConnect();
    } else if (!isConnected && onDisconnect) {
      onDisconnect();
    }
  }, [isConnected, onConnect, onDisconnect]);

  // Auto-connect on mount (with small delay to ensure terminal is ready)
  useEffect(() => {
    let timer: ReturnType<typeof setTimeout> | null = null;

    timer = setTimeout(() => {
      if (terminalRef.current && fitAddonRef.current) {
        const dims = fitAddonRef.current.proposeDimensions();
        if (dims) {
          connect(dims.cols, dims.rows);
        }
      }
    }, 100);

    return () => {
      if (timer) clearTimeout(timer);
      disconnect();
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []); // Only run once on mount

  return (
    <div className="h-full w-full p-2 overflow-hidden relative bg-[#1e1e1e]">
      <div ref={containerRef} className="h-full w-full" style={{ outline: 'none' }} />
    </div>
  );
}

