      if (timer) clearTimeout(timer);
      disconnect();
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []); // Only run once on mount

  return (
    <div
      ref={containerRef}
      className="h-full w-full p-2 overflow-hidden bg-[#1e1e1e]"
      style={{ outline: 'none' }}
    />
  );
}

